import React, { Component } from "react";
import { ListGroup, ListGroupItem } from "reactstrap";
import "../assets/img/apple-icon.png";
import "../assets/img/favicon.ico";
import "../assets/css/bootstrap.min.css";
import "../assets/css/light-bootstrap-dashboard.css?v=2.0.0 ";
import "../assets/css/demo.css";

export default class LeftMenu extends Component {


  render() {
    return (

      <div
          class="sidebar"

        >
          <div class="sidebar-wrapper">
            <div class="logo">
              <a class="navbar-brand" href="#">
                <img
                  src={require("../assets/img/iyte_logo-tur.png")}
                  alt=""
                  width="200"
                  height="200"
                />
              </a>
              <a href="http://www.creative-tim.com" class="simple-text">
                IZTECH Graduate Addmissions
              </a>
            </div>
            <ul class="nav">
              <li class="nav-item active">
                <a class="nav-link" href="./Profile.js">
                  <i class="nc-icon nc-circle-09"></i>
                  <p>Account</p>
                </a>
              </li>
              <li>
                <a class="nav-link" href="./table.html">
                  <i class="nc-icon nc-badge"></i>
                  <p>Interviews</p>
                </a>
              </li>
              <li>
                <a class="nav-link" href="./typography.html">
                  <i class="nc-icon nc-bullet-list-67"></i>
                  <p>Progress</p>
                </a>
              </li>
              <li>
                <a class="nav-link" href="./notifications.html">
                  <i class="nc-icon nc-bell-55"></i>
                  <p>Notifications</p>
                </a>
              </li>
              <li class="nav-item active active-pro">
                <a class="nav-link active" href="upgrade.html">
                  <i class="nc-icon nc-paper-2"></i>
                  <p>Application File</p>
                </a>
              </li>
            </ul>
          </div>
        </div>

      // <div>
      //   <h3>{this.props.info.title}</h3>
      //   <ListGroup>
      //     {this.props.menuElements.map((category) => (
      //       <ListGroupItem
      //         onClick={() => this.props.changeCategory(category)}
      //         key={category.CategoryName}
      //       >
      //         {category.CategoryName}
      //       </ListGroupItem>
      //     ))}
      //   </ListGroup>
      // </div>
    );
  }
}
